"9587":{"id":"9587","name":"Adoráveis Mulheres","slug":"adoraveis-mulheres","original_title":"Little Women","overview":"Durante a Guerra Civil, uma mãe com 4 filhas passa por graves problemas finaceiros, enquanto o marido está na frente de batalha. A mais intelectualizada das irmãs, que sonha ser escritora, é cortejada por um rico vizinho, mas quando este se declara ela o rejeita e vai morar em Nova York, onde se envolve com um professor. Mas quando chega a notícia de que o estado de saúde de uma de suas irmãs piorou consideravelmente, ela retorna para casa.","first_air_date":"1994-12-21","runtime":115,"episode_run_time":[115],"vote_average":7.3,"created_by":["Di Novi Pictures"],"production_companies":[{"name":"Di Novi Pictures"}],"cast":["Winona Ryder","Trini Alvarado","Samantha Mathis","Kirsten Dunst","Claire Danes"],"backdrop_path":"https://image.tmdb.org/t/p/original/lmMVUuu2hHX6qrpcusiuSGU8HaC.jpg","poster_path":"https://image.tmdb.org/t/p/original/hsbkfb9xnXhBlkg6jXNMuHKyQN5.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
