"77953":{"id":"77953","name":"Os Candidatos","slug":"os-candidatos","original_title":"The Campaign","overview":"Cam Brady é um político calejado, que conhece bem o meio em que trabalha, mas às vésperas do período eleitoral ele realiza um comício que foi um verdadeiro fiasco. Para tirar proveito do momento ruim de Brady, um grupo de empresários milionários resolve investir em um candidato capaz de concorrer com o veterano nas eleições, o inexperiente Marty Huggins. Marty, que trabalhava no ramo do turismo, aos poucos vai ganhando jogo de cintura e o carisma necessário para preocupar Brady. O dia de votar se aproxima, a tensão entre os dois candidatos cresce e eles vão fazer de tudo para se dar bem nas urnas.","first_air_date":"2012-08-09","runtime":85,"episode_run_time":[85],"vote_average":5.8,"created_by":["Location Gourmet","Gary Sanchez Productions","Everyman Pictures","Warner Bros. Pictures"],"production_companies":[{"name":"Location Gourmet"},{"name":"Gary Sanchez Productions"},{"name":"Everyman Pictures"},{"name":"Warner Bros. Pictures"}],"cast":["Will Ferrell","Zach Galifianakis","Jason Sudeikis","Katherine LaNasa","Dylan McDermott"],"backdrop_path":"https://image.tmdb.org/t/p/original/3gsn2rViobMWbyJ0M20Zpur20w0.jpg","poster_path":"https://image.tmdb.org/t/p/original/yNVKRSwGM3nokNDeZA8J8cDfiS0.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
