"105077":{"id":"105077","name":"Battlestar Galactica: O Plano","slug":"battlestar-galactica-o-plano","original_title":"Battlestar Galactica: The Plan","overview":"Após serem criados pelos homens, os Cylons os serviram por muitos anos, até se revoltarem, evoluírem e assumirem a forma humana. Agora, eles planejam destruir seus criadores. Só que quando seu ataque genocida deixa sobreviventes, dois líderes Cylons, dois clones Número Um (Dean Stockwell), trabalham separadamente para bolar um novo plano que irá eliminar o restante da humanidade. Enquanto isso, o Comandante da nave Galactica, William Adama (Edward James Olmos), e sua frota lutam pela sobrevivência.","first_air_date":"2009-10-27","runtime":112,"episode_run_time":[112],"vote_average":6.7,"created_by":["David Eick Productions","R&D TV"],"production_companies":[{"name":"David Eick Productions"},{"name":"R&D TV"}],"cast":["Edward James Olmos","Dean Stockwell","Michael Trucco","Grace Park","Michael Hogan"],"backdrop_path":"https://image.tmdb.org/t/p/original/snSFUEA5ftPfrXVb0xphitD2VrP.jpg","poster_path":"https://image.tmdb.org/t/p/original/54VeOaUh9XIyPo7aJPX271xKpLW.jpg","certification":"N/A","genres":["Ficção científica","Ação","Drama"],"trailer":"N/A"},
"40096":{"id":"40096","name":"O Auto da Compadecida","slug":"o-auto-da-compadecida","original_title":"O Auto da Compadecida","overview":"As aventuras dos nordestinos João Grilo, um sertanejo pobre e mentiroso, e Chicó, o mais covarde dos homens. Ambos lutam pelo pão de cada dia e atravessam por vários episódios enganando a todos do pequeno vilarejo de Taperoá, no sertão da Paraíba. A salvação da dupla acontece com a aparição da Nossa Senhora. Adaptação da obra de Ariano Suassuna.","first_air_date":"2000-09-15","runtime":104,"episode_run_time":[104],"vote_average":8.4,"created_by":["Lereby Produções","Globo Filmes","Estúdios Globo"],"production_companies":[{"name":"Lereby Produções"},{"name":"Globo Filmes"},{"name":"Estúdios Globo"}],"cast":["Matheus Nachtergaele","Selton Mello","Rogério Cardoso","Denise Fraga","Diogo Vilela"],"backdrop_path":"https://image.tmdb.org/t/p/original/alQqTpmEkxSLgajfEYTsTH6nAKB.jpg","poster_path":"https://image.tmdb.org/t/p/original/xWCKF7hgOicb3A0XiY13SdlwRcn.jpg","certification":"L","genres":["Comédia","Drama","Fantasia"],"trailer":"XPuMu_ENzlg"},
"624479":{"id":"624479","name":"Superman II: A Aventura Continua (Versão do Diretor)","slug":"superman-ii-a-aventura-continua-versao-do-diretor","original_title":"Superman II: The Richard Donner Cut","overview":"Originalmente, os dois primeiros filmes da série Superman seriam filmados simultaneamente por Richard Donner. Porém, após o lançamento e grande sucesso do primeiro filme, os produtores demitiram Donner e colocaram em seu lugar Richard Lester, que refilmou grande parte das cenas filmadas por Donner. Em 2006, foi lançado direto para vídeo \"Superman II: The Richard Donner Cut\", que traz a visão original de Donner para o filme, com cenas inéditas e inumeras diferenças comparando com a versão de 1980.","first_air_date":"2006-11-02","runtime":116,"episode_run_time":[116],"vote_average":7.3,"created_by":["Warner Bros. Pictures","DC","Dovemead Films"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"DC"},{"name":"Dovemead Films"}],"cast":["Christopher Reeve","Margot Kidder","Gene Hackman","Marlon Brando","Ned Beatty"],"backdrop_path":"https://image.tmdb.org/t/p/original/rRo1EzVd0E8GAOAeCulPpekKwjP.jpg","poster_path":"https://image.tmdb.org/t/p/original/2I2GyR0XPv4EkibSSirfdlYwJwW.jpg","certification":"L","genres":["Ficção científica","Ação","Aventura"],"trailer":"N/A"},
