"1002185":{"id":"1002185","name":"A Milhões de Quilômetros","slug":"a-milhoes-de-quilometros","original_title":"A Million Miles Away","overview":"Inspirado na história real do engenheiro da Nasa, José Hernández, este filme acompanha sua família de fazendeiros migrantes em sua jornada desde uma vila rural em Michoacán, no México, para mais de 300 quilômetros acima da Terra na Estação Espacial Internacional. Com o apoio da família, o foco e a determinação de José culminam na oportunidade de alcançar esse objetivo impossível.","first_air_date":"2023-09-08","runtime":123,"episode_run_time":[123],"vote_average":7.7,"created_by":["Select Films","Redrum","Amazon MGM Studios"],"production_companies":[{"name":"Select Films"},{"name":"Redrum"},{"name":"Amazon MGM Studios"}],"cast":["Michael Peña","Rosa Salazar","Julio Cesar Cedillo","Veronica Falcón","Juanpi Monterrubio"],"backdrop_path":"https://image.tmdb.org/t/p/original/23HvwdsAQeL0MxN9fm3d8m1NaPw.jpg","poster_path":"https://image.tmdb.org/t/p/original/gve64tTbxgo5NErRkwKeMdlHt5o.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
