"11355":{"id":"11355","name":"Nunca Fui Beijada","slug":"nunca-fui-beijada","original_title":"Never Been Kissed","overview":"Josie Geller (Drew Barrymore) está pronta para uma mudança radical. Ela é a mais jovem editora de um grande jornal, mas nunca foi levada a sério como jornalista, apesar de ser uma profissional supercompetente. Dedica todo o seu tempo exclusivamente ao trabalho, já sua vida pessoal é uma outra história. Ainda marcada pela sua reputação de adolescente babaca, Josie é uma garota de 25 anos que nunca namorou e nunca foi beijada... até agora! Contra tudo e todos, Josie consegue sua primeira missão como repórter. Ela precisa fingir que é uma estudante e entrar numa escola para descobrir a intimidade dos jovens alunos. A situação torna-se hilariante quando Josie revive sua própria história conhece um amor em potencial e sente na própria pelo os dramas da adolescência.","first_air_date":"1999-04-09","runtime":107,"episode_run_time":[107],"vote_average":6.2,"created_by":["Fox 2000 Pictures","Bushwood Pictures","Flower Films","Never Been Kissed Productions","20th Century Fox"],"production_companies":[{"name":"Fox 2000 Pictures"},{"name":"Bushwood Pictures"},{"name":"Flower Films"},{"name":"Never Been Kissed Productions"},{"name":"20th Century Fox"}],"cast":["Drew Barrymore","David Arquette","Molly Shannon","Michael Vartan","Jessica Alba"],"backdrop_path":"https://image.tmdb.org/t/p/original/77gWYPFcFIAdDu21digPWdVX2Q2.jpg","poster_path":"https://image.tmdb.org/t/p/original/txX1wXYysKGkDGi4EsHTcq1KwZz.jpg","certification":"12","genres":["Romance","Comédia","Drama"],"trailer":"N/A"},
