"16614":{"id":"16614","name":"Férias Frustradas de Verão","slug":"ferias-frustradas-de-verao","original_title":"Adventureland","overview":"1987. James Brennan (Jesse Eisenberg) acaba de se formar na faculdade e sonhava em passar as férias de verão na Europa. Entretanto, a difícil situação financeira de seus pais impede que realize o sonho e, além disto, tenha que conseguir o quanto antes um emprego de verão. James consegue uma vaga no Adventureland, um parque de diversões onde atende o público junto aos brinquedos. De início ele não gosta do local, mas tudo muda quando começa a se interessar por Em Lewin (Kristen Stewart), uma colega de trabalho.","first_air_date":"2009-04-03","runtime":107,"episode_run_time":[107],"vote_average":6.4,"created_by":["Miramax","This is that","Sidney Kimmel Entertainment"],"production_companies":[{"name":"Miramax"},{"name":"This is that"},{"name":"Sidney Kimmel Entertainment"}],"cast":["Jesse Eisenberg","Kristen Stewart","Martin Starr","Kristen Wiig","Bill Hader"],"backdrop_path":"https://image.tmdb.org/t/p/original/88R3QYgd4hGO8JKp9Dyc0Nq3vQ4.jpg","poster_path":"https://image.tmdb.org/t/p/original/r3N1tfzMOoGK8KIFT2OAOb9oUoh.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
