"13768":{"id":"13768","name":"Vivendo na Eternidade","slug":"vivendo-na-eternidade","original_title":"Tuck Everlasting","overview":"Na 2ª década do século XX vive Winnie Foster, uma \"ave em uma gaiola de ouro\", pois seus pais são muito ricos mas não a deixam aproveitar a vida. Esta situação muda bruscamente quando vê Jesse Tuck bebendo em uma fonte. Inicialmente ele tentou intimidá-la, mas ela se negou, pois o pai dela era o dono do bosque. Winnie acaba conhecendo a família Tuck. Seu medo inicial é substituído por uma sensação de liberdade, que nunca experimentou na vida, e ela e Jesse se sentem cada vez mais atraídos. Quando Winnie pergunta a Jesse sua idade, ele responde que tem 104 anos. Obviamente ela não crê, pois ele aparenta ter 17 anos, mas gradativamente ela fica sabendo que todos os Tuck são incapazes de morrem e o segredo está na água da fonte do bosque. Paralelamente os pais de Winnie acham que foi seqüestrada e organizam uma busca","first_air_date":"2002-10-11","runtime":90,"episode_run_time":[90],"vote_average":6.6,"created_by":["Walt Disney Pictures"],"production_companies":[{"name":"Walt Disney Pictures"}],"cast":["Alexis Bledel","William Hurt","Sissy Spacek","Jonathan Jackson","Scott Bairstow"],"backdrop_path":"https://image.tmdb.org/t/p/original/2mNUbRzy8QqFMxP6B9dxqlt998n.jpg","poster_path":"https://image.tmdb.org/t/p/original/ahvmDquJV5IP5QaTvlgV3zhDNAx.jpg","certification":"N/A","genres":["Drama","Família","Fantasia","Romance"],"trailer":"N/A"},
