"12639":{"id":"12639","name":"A Volta dos Sete Homens","slug":"a-volta-dos-sete-homens","original_title":"Return of the Seven","overview":"Seis anos se passaram desde que Chico (Julian Mateos) cavalgou ao lado de Chris Adams (Bryner) e de seu bando pistoleiro. Neste meio tempo, ele casou-se com a bela Petra (Elisa Monters) e prometeu abandonar suas armas para sempre. Mas o cruel fora-da-lei Lorca (Emilio Fernandez) começa a aterrorizar sua cidade. Chico e outros cinco corajosos pistoleiros decidem enfrentá-los. Agora, com as probabilidades contra eles, os sete bravos surgem com suas armas fumegantes para enfrentar o tiroteio de suas vidas… Naquela que pode ser sua última batalha!","first_air_date":"1966-10-19","runtime":95,"episode_run_time":[95],"vote_average":6.2,"created_by":["C.B. Films S.A.","The Mirisch Company","United Artists"],"production_companies":[{"name":"C.B. Films S.A."},{"name":"The Mirisch Company"},{"name":"United Artists"}],"cast":["Yul Brynner","Robert Fuller","Julián Mateos","Warren Oates","Claude Akins"],"backdrop_path":"https://image.tmdb.org/t/p/original/64ABp1dJnwqZJl9DIEMe6UObhOu.jpg","poster_path":"https://image.tmdb.org/t/p/original/oLczCuMwpNzwfncJs2Osrs9boAz.jpg","certification":"N/A","genres":["Faroeste"],"trailer":"N/A"},
"501979":{"id":"501979","name":"Bill & Ted: Encare a Música","slug":"bill-ted-encare-a-musica","original_title":"Bill & Ted Face the Music","overview":"Três décadas depois, Bill e Ted ainda não conseguiram escrever a melhor música de todos os tempos. Os amigos, então, têm a ideia genial de viajar para o futuro, para quando já tiverem escrito a música, e roubá-la de si mesmos... O que poderia dar errado? Ao lado das suas famílias e da inseparável amiga Morte, eles precisam encontrar a música perdida e salvar o mundo de uma possível catástrofe. Tudo isso, claro, sendo excelentes uns com os outros e deixando a festa rolar!","first_air_date":"2020-08-27","runtime":91,"episode_run_time":[91],"vote_average":5.9,"created_by":["Endeavor Content","Hammerstone Studios","TinRes Entertainment","Many Rivers Productions","Cittadino/Dugan Entertainment","Orion Pictures","Bloom"],"production_companies":[{"name":"Endeavor Content"},{"name":"Hammerstone Studios"},{"name":"TinRes Entertainment"},{"name":"Many Rivers Productions"},{"name":"Cittadino/Dugan Entertainment"},{"name":"Orion Pictures"},{"name":"Bloom"}],"cast":["Keanu Reeves","Alex Winter","Kristen Schaal","Samara Weaving","Jack Haven"],"backdrop_path":"https://image.tmdb.org/t/p/original/oazPqs1z78LcIOFslbKtJLGlueo.jpg","poster_path":"https://image.tmdb.org/t/p/original/8I2oy8pXP6T70bVxYSjwUTKn2DS.jpg","certification":"10","genres":["Comédia","Ficção científica","Aventura"],"trailer":"UZe0BRaqPlo"},
