"11317":{"id":"11317","name":"Meu Primeiro Amor, Parte 2","slug":"meu-primeiro-amor-parte-2","original_title":"My Girl 2","overview":"O ano agora é 1974, Vada tem 13 anos e seu pai (Dan Aykroyd) se casou com a grávida Shelly (Jamie Lee Curtis). Quando Vada decide escrever sobre sua falecida mãe numa redação da escola, ela convence o pai a deixá-la viajar até Los Angeles para buscar mais informações sobre o passado de sua mãe. Lá, ela visita seu tio Phil (Richard Masur), que recruta o filho da sua namorada, Nick (Austin O'Brien), para ser o guia turístico de Vada. Quando um rastro de pistas dispersas os levam a uma variedade de personagens e Marcos de Los Angeles, Vada começa a formar a imagem de sua mãe, e a aversão inicial entre Vada e Nick é gradualmente substituída por uma amizade ou quem sabe algo mais.","first_air_date":"1994-02-11","runtime":99,"episode_run_time":[99],"vote_average":6.0,"created_by":["Columbia Pictures","Imagine Entertainment"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Imagine Entertainment"}],"cast":["Anna Chlumsky","Austin O'Brien","Dan Aykroyd","Jamie Lee Curtis","Richard Masur"],"backdrop_path":"https://image.tmdb.org/t/p/original/hjPVkTY33THHwSJ0lWbwRZcX8y4.jpg","poster_path":"https://image.tmdb.org/t/p/original/v1JD3VpeAevtfQZVAX6gYtpsIYM.jpg","certification":"6","genres":["Comédia","Família"],"trailer":"rgOYdPWH8Kw"},
