"2925":{"id":"2925","name":"O Clube das Desquitadas","slug":"o-clube-das-desquitadas","original_title":"The First Wives Club","overview":"Três amigas de faculdade que se formaram em 1969 e tomaram caminhos distintos (uma é atriz (Goldie Hawn), a outra (Diane Keaton) casou-se com magnata dono de uma cadeia de lojas de eletrodomésticos e a última (Bette Midler) se tornou uma dona de casa) têm algo em comum: todas foram trocadas por mulheres mais jovens, o que as deixa revoltadas, pois elas contribuíram para a ascensão profissional e financeira de seus maridos. Porém, quando uma amiga delas se suicida após o marido trocá-la por uma mulher mais jovem as três decidem se unir, atacando os seus \"ex\" no ponto mais sensível: o bolso.","first_air_date":"1996-09-20","runtime":103,"episode_run_time":[103],"vote_average":6.7,"created_by":["Scott Rudin Productions"],"production_companies":[{"name":"Scott Rudin Productions"}],"cast":["Goldie Hawn","Bette Midler","Diane Keaton","Maggie Smith","Sarah Jessica Parker"],"backdrop_path":"https://image.tmdb.org/t/p/original/wGjomtPb4dSTeb9qoNfNft16Nx2.jpg","poster_path":"https://image.tmdb.org/t/p/original/6IiYfY1In6VTtjZJ2dhBmCHYYLP.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"39013":{"id":"39013","name":"Inverno da Alma","slug":"inverno-da-alma","original_title":"Winter's Bone","overview":"Aos 17 anos de idade, Ree Dolly (Jennifer Lawrence) embarca em uma missão para encontrar seu pai, já que ele usou a casa de sua família como forma de garantir sua liberdade condicional e desapareceu sem deixar vestígios. Confrontada com a possibilidade de perder a casa onde mora com seus irmãos pequenos e precisar voltar para a floresta de Ozark, Ree desafia os códigos e a lei do silêncio arriscando sua vida para salvar sua família. Ela desafia as mentiras, fugas e ameaças oferecidas por seus parentes e, dessa forma, começa a juntar a verdade sobre seu pai.","first_air_date":"2010-06-11","runtime":100,"episode_run_time":[100],"vote_average":6.8,"created_by":["Anonymous Content","Winter's Bone Productions","Fortissimo Films"],"production_companies":[{"name":"Anonymous Content"},{"name":"Winter's Bone Productions"},{"name":"Fortissimo Films"}],"cast":["Jennifer Lawrence","John Hawkes","Kevin Breznahan","Dale Dickey","Garret Dillahunt"],"backdrop_path":"https://image.tmdb.org/t/p/original/wW4dZWEfUIXWVKhKsPFBokndJbI.jpg","poster_path":"https://image.tmdb.org/t/p/original/gQEGofSZEqBlLvmi5bHIQprTuP4.jpg","certification":"16","genres":["Drama","Mistério"],"trailer":"ihcTyPaRxVk"},
"454293":{"id":"454293","name":"Operação Supletivo: Agora Vai!","slug":"operacao-supletivo-agora-vai","original_title":"Night School","overview":"Após perder o emprego, Teddy (Kevin Hart) decide voltar a estudar para conseguir um diploma que lhe dará mais chances no mercado de trabalho. Remanejado para uma turma noturna, ele se depara com uma professora de métodos nada ortodoxos e alunos (Rob Riggle, Romany Malco, Mary Lynn Rajskub) com diferentes ambições.","first_air_date":"2018-09-27","runtime":111,"episode_run_time":[111],"vote_average":6.1,"created_by":["HartBeat Productions","Will Packer Productions","Perfect World Pictures","Universal Pictures"],"production_companies":[{"name":"HartBeat Productions"},{"name":"Will Packer Productions"},{"name":"Perfect World Pictures"},{"name":"Universal Pictures"}],"cast":["Kevin Hart","Tiffany Haddish","Rob Riggle","Romany Malco","Taran Killam"],"backdrop_path":"https://image.tmdb.org/t/p/original/1dDSULh0SQxCgNdPafbC0gWeIaY.jpg","poster_path":"https://image.tmdb.org/t/p/original/I1jDPWDC3DvnZTViTaOPKCF1YU.jpg","certification":"12","genres":["Comédia"],"trailer":"N/A"},
"10616":{"id":"10616","name":"Hitman, O Rei dos Assassinos","slug":"hitman-o-rei-dos-assassinos","original_title":"殺手之王","overview":"Tsukamoto Nakasome, um velho chefão da Yakuza rico e poderoso, é morto pelo \"Rei dos Assassinos\", um vingador mascarado de identidade desconhecida determinado a exterminar os piores criminosos. Porém, o rico homem de negócios havia deixado uma recompensa de 100 milhões de dólares como \"Fundo de Vingança\", para aquele que matasse seu assassino. Isso faz com que os maiores matadores do mundo começam a caçar o \"Rei dos Assassinos\". Fred, um ex-soldado, resolve tornar-se um assassino profissional e assim tentar receber a recompensa. Logo Fred irá descobrir que com tanto dinheiro envolvido, além de caçador, também irá se tornar alvo de uma violenta e impiedosa caçada.","first_air_date":"1998-04-03","runtime":104,"episode_run_time":[104],"vote_average":7.0,"created_by":["Flea Market","China Star Entertainment","Win's Entertainment Ltd."],"production_companies":[{"name":"Flea Market"},{"name":"China Star Entertainment"},{"name":"Win's Entertainment Ltd."}],"cast":["Jet Li","梁詠琪","曾志偉","任達華","何寶生"],"backdrop_path":"https://image.tmdb.org/t/p/original/mImqLaH73vb5zgy8YKA8QLHCMMm.jpg","poster_path":"https://image.tmdb.org/t/p/original/if62hnWJpSn2392UiNAeTMDST81.jpg","certification":"16","genres":["Ação","Comédia","Thriller"],"trailer":"N/A"},
