"11708":{"id":"11708","name":"O Calhambeque Mágico","slug":"o-calhambeque-magico","original_title":"Chitty Chitty Bang Bang","overview":"Na primeira década do século XX um carro de corrida, que tinha ganho três grandes prêmios, sofre um acidente e fica totalmente queimado. Algum tempo depois duas crianças, Jemima (Heather Ripley) e Jeremy (Adrian Hall), os filhos de Caractacus Potts (Dick Van Dyke), um inventor fracassado, vêem a carcaça deste carro de corrida, que seria vendido por 30 xelins. Eles imploram ao pai que o compre, mas Potts está sem dinheiro e o avô das crianças (Lionel Jeffries), que mora com eles, se encontra na mesma situação. Após uma tentativa desastrosa de vender uma de suas invenções para o Lorde Scrumptious (James Robertson Justice), o fabricante de doces da região, Potts consegue acidentalmente dinheiro suficiente em um parque de diversões. Potts compra o carro e, milagrosamente, transforma um veículo que estava caindo aos pedaços em um carro novo em folha.","first_air_date":"1968-12-17","runtime":144,"episode_run_time":[144],"vote_average":6.8,"created_by":["United Artists","Dramatic Features","Warfield"],"production_companies":[{"name":"United Artists"},{"name":"Dramatic Features"},{"name":"Warfield"}],"cast":["Dick Van Dyke","Sally Ann Howes","Lionel Jeffries","Gert Fröbe","Anna Quayle"],"backdrop_path":"https://image.tmdb.org/t/p/original/iYfaeF9N2YZMrfgbzxq7LF4UQ95.jpg","poster_path":"https://image.tmdb.org/t/p/original/mMvD7uEKO1hwKTlZtDqiCK323sQ.jpg","certification":"L","genres":["Família","Música","Aventura","Fantasia","Comédia"],"trailer":"N/A"},
