"335778":{"id":"335778","name":"Ressurreição","slug":"ressurreicao","original_title":"Risen","overview":"Às vésperas de um levante em Jerusalém, surgem rumores de que o Messias judeu ressuscitou. Um centurião romano agnóstico e cético é enviado por Pôncio Pilatos para investigar a ressurreição e localizar o corpo desaparecido do já falecido e crucificado Jesus de Nazaré, a fim de subjulgar a revolta eminente. Conforme ele apura os fatos e ouve depoimentos, suas dúvidas sobre o evento milagroso começam a sumir.","first_air_date":"2016-02-18","runtime":108,"episode_run_time":[108],"vote_average":6.2,"created_by":["Patrick Aiello Productions","Affirm Films","Columbia Pictures","LD Entertainment"],"production_companies":[{"name":"Patrick Aiello Productions"},{"name":"Affirm Films"},{"name":"Columbia Pictures"},{"name":"LD Entertainment"}],"cast":["Joseph Fiennes","Peter Firth","Cliff Curtis","Tom Felton","Mark Killeen"],"backdrop_path":"https://image.tmdb.org/t/p/original/lvyU838cy3m0fKSfQIxN8grjxYr.jpg","poster_path":"https://image.tmdb.org/t/p/original/s94MQfIpOx2cqhbTBLBXEmjs5LL.jpg","certification":"12","genres":["Ação","Aventura","Drama","Fantasia"],"trailer":"N/A"},
