"17335":{"id":"17335","name":"Obsessiva","slug":"obsessiva","original_title":"Obsessed","overview":"Derek (Idris Elba) trabalha como vice-presidente de uma conceituada empresa, é casado com Sharon (Beyoncé Knowles), com quem tem um filho, e acaba se mudar para uma casa confortável. Um dia, ao chegar no trabalho, ele conhece no elevador Lisa (Ali Larter), uma funcionária temporária. Eles trocam gentilezas e há um nítido interesse de Derek por ela. Lisa percebe e passa a se informar sobre a vida de Derek. Ela aproveita a festa de Natal da empresa para incentivá-lo a beber e então agarrá-lo. Entretanto, Derek se recusa a ter algo com ela e se afasta. Sem aceitar a situação, Lisa passa a persegui-lo cada vez mais.","first_air_date":"2009-02-26","runtime":108,"episode_run_time":[108],"vote_average":5.7,"created_by":["Screen Gems","Sony Pictures","Parkwood Entertainment","Rainforest Entertainment"],"production_companies":[{"name":"Screen Gems"},{"name":"Sony Pictures"},{"name":"Parkwood Entertainment"},{"name":"Rainforest Entertainment"}],"cast":["Idris Elba","Beyoncé","Ali Larter","Jerry O'Connell","Christine Lahti"],"backdrop_path":"https://image.tmdb.org/t/p/original/sSrsOk5Jw5Fi5GDr6xq0gX2jpxg.jpg","poster_path":"https://image.tmdb.org/t/p/original/4De1IpEbyhSmRrPivUrpurU7llG.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"Odo8Z9TVTBU"},
"2323":{"id":"2323","name":"Campo dos Sonhos","slug":"campo-dos-sonhos","original_title":"Field of Dreams","overview":"Ray, um agricultor em Iowa, ouve uma voz misteriosa durante à noite vinda do seu milharal dizendo: \"Se você construir, ele virá\", e sente a necessidade de obedecer. Então, ele constrói um campo de beisebol, apoiado por sua mulher, Annie. Mais tarde, os fantasmas de grandes jogadores começam a aparecer para jogar, liderados por \"Shoeless\" Joe Jackson. Ray busca um autor recluso para entender essas mensagens e o verdadeiro propósito do campo que construiu.","first_air_date":"1989-04-21","runtime":105,"episode_run_time":[105],"vote_average":7.1,"created_by":["Universal Pictures","Gordon Company"],"production_companies":[{"name":"Universal Pictures"},{"name":"Gordon Company"}],"cast":["Kevin Costner","Amy Madigan","Gaby Hoffmann","James Earl Jones","Ray Liotta"],"backdrop_path":"https://image.tmdb.org/t/p/original/4srHHwIQvDEw4Ya42Cdfn3V1yhb.jpg","poster_path":"https://image.tmdb.org/t/p/original/dKMDWgdOVCMR11lH3RYB2VnR8YV.jpg","certification":"N/A","genres":["Drama","Fantasia"],"trailer":"N/A"},
