"14136":{"id":"14136","name":"Se Meu Fusca Falasse","slug":"se-meu-fusca-falasse","original_title":"The Love Bug","overview":"Herbie, um Fusca com personalidade própria, é desprezado por um mau caráter que é dono de uma agência de automóveis de luxo e piloto de corridas, mas o Fusca é acolhido por um piloto boa praça e, em gratidão, o pequeno carro lhe dá diversas vitórias, acabando com a maré de azar do piloto, que inicialmente não entende que foi o fusquinha quem ganhou as corridas. Porém, ele aos poucos entende que o carrinho é o principal responsável pelas vitórias e decide correr sempre com ele. Mas ambos terão que lutar contra um rico rival, que usa toda a espécie de golpes sujos para derrotá-los.","first_air_date":"1968-12-23","runtime":108,"episode_run_time":[108],"vote_average":6.5,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Dean Jones","Michele Lee","David Tomlinson","Buddy Hackett","Joe Flynn"],"backdrop_path":"https://image.tmdb.org/t/p/original/w6PpUETms1qZc4WJUqR7PuHpbTT.jpg","poster_path":"https://image.tmdb.org/t/p/original/fAPiPlFQwBTYPIq30fxFKlTZ24d.jpg","certification":"L","genres":["Comédia","Família","Fantasia"],"trailer":"N/A"},
