"461928":{"id":"461928","name":"Anna e o Apocalipse","slug":"anna-e-o-apocalipse","original_title":"Anna and the Apocalypse","overview":"Um apocalipse zumbi ameaça a pacata cidade de Little Haven - no Natal - forçando Anna e seus amigos a lutar, golpear e cantar pela sua sobrevivência, enfrentando mortos-vivos em uma corrida desesperada para encontrar seus entes queridos. Mas logo descobrem que ninguém está seguro neste novo mundo, e com a civilização desmoronando ao redor deles, as únicas pessoas em quem podem realmente confiar são uns nos outros...","first_air_date":"2018-11-30","runtime":93,"episode_run_time":[93],"vote_average":6.0,"created_by":["Parkhouse Pictures","Blazing Griffin","Creative Scotland","Black Camel Pictures"],"production_companies":[{"name":"Parkhouse Pictures"},{"name":"Blazing Griffin"},{"name":"Creative Scotland"},{"name":"Black Camel Pictures"}],"cast":["Ella Hunt","Sarah Swire","Malcolm Cumming","Christopher Leveaux","Paul Kaye"],"backdrop_path":"https://image.tmdb.org/t/p/original/7GR03LqwB7ePPPhaK5BAYNzt3Vm.jpg","poster_path":"https://image.tmdb.org/t/p/original/xNcIsTzSjWKvn9se2gcSOupzWeW.jpg","certification":"N/A","genres":["Terror","Comédia","Fantasia"],"trailer":"MC6xdWlpuns"},
"10061":{"id":"10061","name":"Fuga de Los Angeles","slug":"fuga-de-los-angeles","original_title":"Escape from L.A.","overview":"Em 1998, um candidato à presidência (Cliff Robertson) prega em sua campanha que Los Angeles precisa ser \"punida\" pelos pecados que contém. No ano 2000, a cidade é separada do continente por um grande terremoto e se transforma em um local para qual todos os indesejáveis são remetidos. No ano 2013, o candidato do final do milênio tornou-se presidente vitalício mas sua filha (A.J. Langer), não concordando com a política ditatorial do seu pai, que suprimiu uma série de liberdades individuais, rouba uma \"caixa preta\", que tem o poder de \"desligar\" todo o planeta e a entrega para o principal chefe de quadrilha (Georges Corraface) de Los Angeles. Assim, um aventureiro (Kurt Russell), que é um misto de herói e bandido, mas que em 1997 tinha salvado o presidente dos EUA, é \"convocado\" pelo presidente para recuperar a caixa e matar sua filha. Mas se ele não cumprir a missão em menos de dez horas, será morto por um vírus que foi colocado na sua corrente sanguínea.","first_air_date":"1996-08-09","runtime":100,"episode_run_time":[100],"vote_average":5.9,"created_by":["Paramount Pictures","Rysher Entertainment"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Rysher Entertainment"}],"cast":["Kurt Russell","Stacy Keach","Steve Buscemi","A. J. Langer","Bruce Campbell"],"backdrop_path":"https://image.tmdb.org/t/p/original/7v277jmtG4GfZwM7jQdbTV0WqdZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/tjCah5d0uM3BPRfdmAWVnYB6ZND.jpg","certification":"16","genres":["Ação","Aventura","Ficção científica","Thriller"],"trailer":"N/A"},
