"8834":{"id":"8834","name":"Teoria da Conspiração","slug":"teoria-da-conspiracao","original_title":"Conspiracy Theory","overview":"Em Nova York, Jerry Fletcher é um motorista de taxi que critica o governo e fala sempre da existência de uma conspiração envolvendo altos escalões. Ele ama Alice Sutton, uma mulher que ele observa à distância e que ironicamente trabalha para o governo. Porém, nela Jerry acredita, tanto que faz alvoroço no Departamento de Justiça para falar com Alice, mas ninguém lhe dá atenção sobre suas teorias, que envolvem alienígenas e assassinatos. No entanto, ele escreveu algo em seu jornal (com apenas 5 assinantes) que alguém acreditou, pois decidiram matá-lo de qualquer jeito.","first_air_date":"1997-08-08","runtime":135,"episode_run_time":[135],"vote_average":6.6,"created_by":["Silver Pictures","Warner Bros. Pictures","Donner/Shuler-Donner Productions"],"production_companies":[{"name":"Silver Pictures"},{"name":"Warner Bros. Pictures"},{"name":"Donner/Shuler-Donner Productions"}],"cast":["Mel Gibson","Julia Roberts","Patrick Stewart","Cylk Cozart","Steve Kahan"],"backdrop_path":"https://image.tmdb.org/t/p/original/c0G6f2GFlDFujX976oiak8VsR2I.jpg","poster_path":"https://image.tmdb.org/t/p/original/3KtcBsGc2i365cXOITuSjHqq8OS.jpg","certification":"N/A","genres":["Ação","Drama","Mistério","Thriller"],"trailer":"N/A"},
