"14564":{"id":"14564","name":"O Chamado 3","slug":"o-chamado-3","original_title":"Rings","overview":"Julia (Matilda Anna Ingrid Lutz) fica preocupada quando seu namorado, Holt (Alex Roe), começa a explorar a lenda urbana sobre um vídeo misterioso. Lenda esta que diz que quem assiste morre depois de sete dias. Ela se sacrifica para salvar seu namorado e acaba fazendo uma descoberta terrível: há um \"filme dentro do filme\" que ninguém nunca viu antes.","first_air_date":"2017-02-01","runtime":117,"episode_run_time":[117],"vote_average":5.0,"created_by":["Paramount Pictures","Macari/Edelstein","Parkes+MacDonald Image Nation","Waddieish Claretrap"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Macari/Edelstein"},{"name":"Parkes+MacDonald Image Nation"},{"name":"Waddieish Claretrap"}],"cast":["Matilda Lutz","Alex Roe","Johnny Galecki","Vincent D'Onofrio","Aimee Teegarden"],"backdrop_path":"https://image.tmdb.org/t/p/original/a4r8xcRwTgKIUKdWtxFXyxTZLeN.jpg","poster_path":"https://image.tmdb.org/t/p/original/dvsh3qYE2TVhjlQFYV7o13jTAvr.jpg","certification":"14","genres":["Terror"],"trailer":"1jElhY8Mzjo"},
"962":{"id":"962","name":"Em Busca do Ouro","slug":"em-busca-do-ouro","original_title":"The Gold Rush","overview":"No Alasca, Carlitos (Charles Chaplin) tenta a sorte como garimpeiro em meio a corrida do ouro de 1898. Lá ele conhece o gordo McKay (Mack Swaim), com quem cria bastante confusão após uma tempestade de neve, e se apaixona por uma dançarina (Georgia Hale).","first_air_date":"1925-07-13","runtime":95,"episode_run_time":[95],"vote_average":8.0,"created_by":["Charles Chaplin Productions"],"production_companies":[{"name":"Charles Chaplin Productions"}],"cast":["Charlie Chaplin","Mack Swain","Tom Murray","Henry Bergman","Malcolm Waite"],"backdrop_path":"https://image.tmdb.org/t/p/original/bymglyc0M1QXHikGMkl0OclvaYV.jpg","poster_path":"https://image.tmdb.org/t/p/original/oPUeIGsGi32v9EtEzxcHfzmQDLj.jpg","certification":"L","genres":["Aventura","Comédia","Drama"],"trailer":"N/A"},
"14811":{"id":"14811","name":"Um Violinista no Telhado","slug":"um-violinista-no-telhado","original_title":"Fiddler on the Roof","overview":"Violinista de aldeia ucraniana e seus habitantes de origem judia são intimados pelo czar a deixar o país em apenas três dias. Começa assim o sofrido êxodo para os países ocidentais, onde são mostrados os dramas individuais de alguns personagens. Baseado no livro \"Tevye's Daughters and play Tevye der Milkhiker\", de Sholem Aleichem, por sua vez levado aos palcos da Broadway por Joseph Stein.","first_air_date":"1971-11-03","runtime":181,"episode_run_time":[181],"vote_average":7.7,"created_by":["United Artists","Cartier Productions","The Mirisch Company"],"production_companies":[{"name":"United Artists"},{"name":"Cartier Productions"},{"name":"The Mirisch Company"}],"cast":["Topol","Norma Crane","Leonard Frey","Molly Picon","Paul Mann"],"backdrop_path":"https://image.tmdb.org/t/p/original/rqnOgJWvlURkcOWfGqiACvkTAqG.jpg","poster_path":"https://image.tmdb.org/t/p/original/ZcnidWFi1gMJdawDTHQ6G1z9NO.jpg","certification":"L","genres":["Drama","Romance"],"trailer":"N/A"},
"9745":{"id":"9745","name":"Uma Noite Mágica","slug":"uma-noite-magica","original_title":"Jack Frost","overview":"Jack Frost (Michael Keaton) é um cantor que sempre está viajando, assim ele não pode passar muito tempo com Charlie Frost (Joseph Cross), seu filho. Ironicamente quando Jack decide não ir fazer um teste, que poderia resultar em contrato com uma gravadora, para se encontrar com Gabby Frost (Kelly Preston), sua mulher, e Charlie e passarem o Natal juntos, Jack morre em um acidente de carro. Charlie fica bastante triste, mas um ano depois Jack retorna como um boneco de neve. Agora pai e filho podem fazer tudo que tinham perdido quando Jack era um humano, mas as pessoas estão começando a reparar que Charlie sempre conversa com seu boneco de neve. Além disto o tempo está esquentando, o que certamente derreterá o \"corpo\" que Jack agora habita.","first_air_date":"1998-11-15","runtime":101,"episode_run_time":[101],"vote_average":6.0,"created_by":["The Canton Company","Azoff Entertainment","Warner Bros. Pictures"],"production_companies":[{"name":"The Canton Company"},{"name":"Azoff Entertainment"},{"name":"Warner Bros. Pictures"}],"cast":["Michael Keaton","Kelly Preston","Mark Addy","Joseph Cross","Henry Rollins"],"backdrop_path":"https://image.tmdb.org/t/p/original/kVM45FdWgirD08xJAwnRRWMC3QL.jpg","poster_path":"https://image.tmdb.org/t/p/original/uY4BsLttYu4AZ9rBH1EmHps15aK.jpg","certification":"N/A","genres":["Comédia","Família","Drama","Fantasia"],"trailer":"N/A"},
