"2662":{"id":"2662","name":"A Casa dos 1000 Corpos","slug":"a-casa-dos-1000-corpos","original_title":"House of 1000 Corpses","overview":"Na década de 70, dois casais estão fazendo uma viagem em busca de diversão. Ao parar em uma loja de horrores na beira de uma estrada, eles conhecem a história do Dr. Satan (Walter Phelan), um famoso médico que matava suas vítimas aos poucos. Dr. Satan foi preso e enforcado, mas nunca encontraram seu corpo. Animados com a história, os jovens decidem visitar a árvore onde Dr. Satan foi enforcado para tentar descobrir onde está seu corpo atualmente.","first_air_date":"2003-04-11","runtime":89,"episode_run_time":[89],"vote_average":6.2,"created_by":["Spectacle Entertainment Group"],"production_companies":[{"name":"Spectacle Entertainment Group"}],"cast":["Sid Haig","Bill Moseley","Sheri Moon Zombie","Karen Black","Erin Daniels"],"backdrop_path":"https://image.tmdb.org/t/p/original/fGTQXeEbUFWHK7FlJk1Hgc2AHmF.jpg","poster_path":"https://image.tmdb.org/t/p/original/jN1cpttVUjNqbhzRXDt8QVPtGh8.jpg","certification":"18","genres":["Terror"],"trailer":"N/A"},
"716612":{"id":"716612","name":"Spencer","slug":"spencer","original_title":"Spencer","overview":"Nos anos 1990, a Princesa Diana passa o feriado do Natal com a família real na propriedade de Sandringham, em Norfolk, Reino Unido. Apesar das bebidas, brincadeiras e comidas que Diana já sabe o script, esse final de ano vai ser diferente. Após rumores de traição e de divórcio, a princesa se vê em um impasse quando percebe que seu casamento com Príncipe Charles já não está mais dando certo, mesmo com os dois filhos. Portanto, ela decide deixá-lo. Este filme é apenas uma especulação do que pode ter acontecido durante aqueles turbulentos dias...","first_air_date":"2021-11-04","runtime":117,"episode_run_time":[117],"vote_average":6.8,"created_by":["FilmNation Entertainment","Komplizen Film","Shoebox Films","Fabula","Fabula"],"production_companies":[{"name":"FilmNation Entertainment"},{"name":"Komplizen Film"},{"name":"Shoebox Films"},{"name":"Fabula"},{"name":"Fabula"}],"cast":["Kristen Stewart","Timothy Spall","Jack Nielen","Freddie Spry","Jack Farthing"],"backdrop_path":"https://image.tmdb.org/t/p/original/uAf1Ua3UDm8cDR2CgNGbZepOqDV.jpg","poster_path":"https://image.tmdb.org/t/p/original/j0XxLH1QcOrnyxBLvMYWJZSzLfH.jpg","certification":"12","genres":["Drama","História"],"trailer":"Turs-wsFPEY"},
"670439":{"id":"670439","name":"Seis Minutos para Meia-Noite","slug":"seis-minutos-para-meia-noite","original_title":"Six Minutes to Midnight","overview":"Inglaterra, 1939. Thomas Miller (Eddie Izzard) trabalha como professor na Aufgusta-Victoria College, uma escola de elite localizada em uma cidade costeira. Sem saber, o jovem assume a tarefa mais arriscada de sua vida e começa a ensinar a língua inglesa para duas garotas alemãs, filhas de um importante nazista, sob a supervisão da severa Senhorita Rochol (Judi Dench). Quando o corpo de um antigo professor é encontrado, Thomas precisa salvar sua vida e a mente de suas alunas.","first_air_date":"2020-10-15","runtime":99,"episode_run_time":[99],"vote_average":6.2,"created_by":["Mad as Birds","West Madison Entertainment","Ffilm Cymru Wales"],"production_companies":[{"name":"Mad as Birds"},{"name":"West Madison Entertainment"},{"name":"Ffilm Cymru Wales"}],"cast":["Eddie Izzard","Carla Juri","James D'Arcy","Celyn Jones","David Schofield"],"backdrop_path":"https://image.tmdb.org/t/p/original/uTo4Xisq2ikWNp11ULKaSk08954.jpg","poster_path":"https://image.tmdb.org/t/p/original/w07xHq8aJwXNmymaYNkT8sNMSSs.jpg","certification":"14","genres":["Thriller","Drama","História","Guerra"],"trailer":"N/A"},
"10074":{"id":"10074","name":"Loucos Sobre Rodas","slug":"loucos-sobre-rodas","original_title":"Hot Rod","overview":"Rod Kimble (Andy Samberg) vive em uma pequena cidade dos EUA com sua mãe (Sissy Spacek), seu irmão mais novo (Jorma Taccone) e seu padrasto (Ian McShane). Com a família precisando de dinheiro, Rod, que pensa que é um dublê, decide tentar quebrar um recorde mundial de salto com sua mobilete. Esse é o seu grande momento e para melhorar – ou piorar – Denise (Isla Fisher), a vizinha por quem sempre foi apaixonado, está de volta.","first_air_date":"2007-08-03","runtime":88,"episode_run_time":[88],"vote_average":6.4,"created_by":["Paramount Pictures","Broadway Video","Michaels-Goldwyn","The Lonely Island"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Broadway Video"},{"name":"Michaels-Goldwyn"},{"name":"The Lonely Island"}],"cast":["Andy Samberg","Jorma Taccone","Bill Hader","Danny McBride","Isla Fisher"],"backdrop_path":"https://image.tmdb.org/t/p/original/R0p2aJVD7NTrCJFbDlTPKoVCCz.jpg","poster_path":"https://image.tmdb.org/t/p/original/8GqDwWlF1a4MizzlN86HsQvgmpe.jpg","certification":"N/A","genres":["Comédia","Ação"],"trailer":"N/A"},
