"2117":{"id":"2117","name":"Uma Mulher Contra Hitler","slug":"uma-mulher-contra-hitler","original_title":"Sophie Scholl – Die letzten Tage","overview":"Em 1943, Hitler marcha pela Europa em sua devastadora ofensiva. Em Munique, um grupo de jovens universitários apela para a resistência como forma de conter a máquina de guerra nazista. Assim, nasce o Rosa Branca. A única mulher que participa do grupo é Sophie Scholl (Julia Jentsch). Enquanto distribuíam panfletos Sophie e seu irmão, Hans (Fabian Hinrichs), são presos. Os dias que se seguem são de intensos interrogatórios conduzidos pelos oficiais da Gestapo, nos quais ela tenta proteger a qualquer custo os membros da organização.","first_air_date":"2005-02-13","runtime":117,"episode_run_time":[117],"vote_average":7.1,"created_by":["Goldkind Filmproduktion","Broth Film","ARD"],"production_companies":[{"name":"Goldkind Filmproduktion"},{"name":"Broth Film"},{"name":"ARD"}],"cast":["Julia Jentsch","Fabian Hinrichs","Alexander Held","Johanna Gastdorf","André Hennicke"],"backdrop_path":"https://image.tmdb.org/t/p/original/8U9GfW8RVbkfOHExyNxZ6PAvPFQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/z7huBSAjP2cckfcTENk392UNKyb.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
