"76535":{"id":"76535","name":"Marvel One Shot: Aconteceu Uma Coisa Engraçada no Caminho do Martelo de Thor","slug":"marvel-one-shot-aconteceu-uma-coisa-engracada-no-caminho-do-martelo-de-thor","original_title":"Marvel One-Shot: A Funny Thing Happened on the Way to Thor's Hammer","overview":"O curta-metragem acompanha o Agente Coulson após ele deixar o laboratório de Tony Stark em Malibu durante o filme Homem de Ferro 2, e ocorre antes que ele chegue ao local da cratera em Thor. Coulson para em um posto de gasolina para abastecer o seu carro e entra em uma loja de conveniências onde fica em dúvida entre quais rosquinhas vai comprar. Em seguida, dois ladrões entram na loja e mantém a balconista na mira de uma arma. Eis que o Agente Coulson age.","first_air_date":"2011-10-25","runtime":4,"episode_run_time":[4],"vote_average":6.8,"created_by":["Marvel Studios"],"production_companies":[{"name":"Marvel Studios"}],"cast":["Clark Gregg","Jessica Manuel","Jeff Prewett","Zach Hudson"],"backdrop_path":"https://image.tmdb.org/t/p/original/jh8rY4Py4oKWM2x1W9qqUC1LH2V.jpg","poster_path":"https://image.tmdb.org/t/p/original/m1qnAP74odRJzmgzoWmUHqDy7ff.jpg","certification":"12","genres":["Ficção científica","Fantasia"],"trailer":"N/A"},
"10724":{"id":"10724","name":"Raposa de Fogo","slug":"raposa-de-fogo","original_title":"Firefox","overview":"Mitchell Gant é um piloto americano aposentado, que foi abatido e se tornou prisioneiro na Guerra do Vietnã, lhe gerando traumas de guerra. Por ser filho de russos recebe como missão roubar o “Firefox”, o mais avançado caça já fabricado e criado pelos soviéticos. Ele é enviado para a Rússia, mas há um problema: as ordens para comandar a aeronave são dadas por pensamento, mas é necessário que se pense em russo.","first_air_date":"1982-06-18","runtime":136,"episode_run_time":[136],"vote_average":6.0,"created_by":["Malpaso Productions"],"production_companies":[{"name":"Malpaso Productions"}],"cast":["Clint Eastwood","Freddie Jones","David Huffman","Warren Clarke","Ronald Lacey"],"backdrop_path":"https://image.tmdb.org/t/p/original/3mOZ5ZpU3TeibDjFkUV7NkqfX4q.jpg","poster_path":"https://image.tmdb.org/t/p/original/hG8cvRON30sWwiCUibcv2TboQ9A.jpg","certification":"N/A","genres":["Ficção científica","Ação","Aventura","Thriller"],"trailer":"N/A"},
