"8409":{"id":"8409","name":"O Vingador","slug":"o-vingador","original_title":"A Man Apart","overview":"Sean Vetter (Vin Diesel) e Demetrius Hicks (Larenz Tate) são dois policiais que atuam na fronteira dos Estados Unidos com o México, no órgão de combate às drogas. Conhecidos pelo método violento com que agem, eles conseguem prender Memo Lucero (Geno Silva), o famoso líder do Cartel de Baja, o principal grupo traficante local. Após o encarceramento de Lucero em uma prisão de segurança máxima, Vetter acredita que poderá relaxar e ficar mais tempo em casa, com sua esposa Stacy (Jacqueline Obradors). Porém logo após um homem desconhecido, que age sob a alcunha de Diablo, começa a ascender na liderança do Cartel de Baja. Vetter e Hicks partem para tentar identificá-lo, mas Diablo reaje atingindo Vetter em seu ponto mais vulnerável: sua esposa. Arrasado com sua morte, Vetter decide usar todas as formas possíveis para encontrar Diablo e se vingar.","first_air_date":"2003-04-04","runtime":109,"episode_run_time":[109],"vote_average":6.1,"created_by":["Newman/Tooley Films","\"DIA\" Productions GmbH & Co. KG","Joseph Nittolo Entertainment","New Line Cinema"],"production_companies":[{"name":"Newman/Tooley Films"},{"name":"\"DIA\" Productions GmbH & Co. KG"},{"name":"Joseph Nittolo Entertainment"},{"name":"New Line Cinema"}],"cast":["Vin Diesel","Larenz Tate","Timothy Olyphant","Geno Silva","Jacqueline Obradors"],"backdrop_path":"https://image.tmdb.org/t/p/original/bPVCkI1NVHNuAdD9OB5NFHgOSXk.jpg","poster_path":"https://image.tmdb.org/t/p/original/eNCtX8fnHq17lkHG3ZVqVMtTtQT.jpg","certification":"16","genres":["Ação","Drama","Crime"],"trailer":"N/A"},
