"3482":{"id":"3482","name":"O Trem","slug":"o-trem","original_title":"The Train","overview":"Em 1944, um coronel alemão carrega um trem com tesouros de arte francesa para enviar para a Alemanha. A resistência deve pará-lo sem danificar a carga. Quando as forças aliadas se aproximam de Paris em agosto de 1944, o coronel alemão von Waldheim está desesperado para levar todas as maiores pinturas da França para a Alemanha. Ele consegue um trem para transportar as valiosas obras de arte, mesmo com o caos da retirada. A resistência francesa, no entanto, quer impedi-los de roubar seus tesouros nacionais, mas receberam ordens de Londres de que não devem ser destruídas. O chefe da estação, Labiche, tem a tarefa de agendar o trem e fazer tudo acontecer sem problemas, mas ele também faz parte de um grupo cada vez menor de combatentes da resistência encarregados de impedir o roubo. Ele e outros armam um estratagema elaborado para impedir que o trem saia do território francês.","first_air_date":"1964-09-24","runtime":133,"episode_run_time":[133],"vote_average":7.5,"created_by":["Les Productions Artistes Associés","Les Films Ariane","Dear Film","United Artists","Polyphony Digital","Vides Cinematografica"],"production_companies":[{"name":"Les Productions Artistes Associés"},{"name":"Les Films Ariane"},{"name":"Dear Film"},{"name":"United Artists"},{"name":"Polyphony Digital"},{"name":"Vides Cinematografica"}],"cast":["Burt Lancaster","Paul Scofield","Jeanne Moreau","Suzanne Flon","Michel Simon"],"backdrop_path":"https://image.tmdb.org/t/p/original/JnukHKeQNTaCCpsXiCk1VYtVTH.jpg","poster_path":"https://image.tmdb.org/t/p/original/bzgPLB7efMohled42PIn6CcOTnO.jpg","certification":"12","genres":["Guerra","Thriller"],"trailer":"N/A"},
