"4349":{"id":"4349","name":"O Reino","slug":"o-reino","original_title":"The Kingdom","overview":"Incumbido com a tarefa mais difícil de sua carreira, o agente federal Ron Fleury tem uma semana para montar uma equipe, infiltrar-se e destruir uma célula terrorista localizada na Arábia Saudita. Choque cultural e oposição local prejudicam o progresso do grupo de elite, mas a solidariedade inesperada de um capitão da polícia saudita chega na hora certa.","first_air_date":"2007-08-22","runtime":110,"episode_run_time":[110],"vote_average":6.7,"created_by":["Universal Pictures","Forward Pass","Relativity Media","FilmWorks","MDBF Zweite Filmgesellschaft"],"production_companies":[{"name":"Universal Pictures"},{"name":"Forward Pass"},{"name":"Relativity Media"},{"name":"FilmWorks"},{"name":"MDBF Zweite Filmgesellschaft"}],"cast":["Jamie Foxx","Jennifer Garner","Chris Cooper","Jason Bateman","Ali Suliman"],"backdrop_path":"https://image.tmdb.org/t/p/original/qzmCz3tK2v5BFLQYgbQVGmTI3YD.jpg","poster_path":"https://image.tmdb.org/t/p/original/nAUtkD6Qd7JhJ5kAxotUpS0KZQd.jpg","certification":"16","genres":["Thriller","Ação","Drama"],"trailer":"N/A"},
"10653":{"id":"10653","name":"O Pecado Mora ao Lado","slug":"o-pecado-mora-ao-lado","original_title":"The Seven Year Itch","overview":"Após mandar sua mulher para o interior durante o forte verão nova-iorquino, Richard Sherman conhece uma modelo loira sem nome, que é sua nova vizinha do andar de cima. Apesar de acometido de uma recente paranóia sobre a possibilidade de se tornar infiel, no momento ele está lendo um livro chamado \"A Coceira do Sétimo Ano\" (\"The 7 Year Itch\"), que fala das grandes probabilidades do homem se tornar infiel após sete anos de casamento. E este é exatamente o tempo que ele tem de casado. Mesmo assim, ele convida a moça para tomar um drink em seu apartamento e se tornam amigos.","first_air_date":"1955-06-03","runtime":105,"episode_run_time":[105],"vote_average":7.1,"created_by":["Charles K. Feldman Group","20th Century Fox"],"production_companies":[{"name":"Charles K. Feldman Group"},{"name":"20th Century Fox"}],"cast":["Marilyn Monroe","Tom Ewell","Evelyn Keyes","Sonny Tufts","Robert Strauss"],"backdrop_path":"https://image.tmdb.org/t/p/original/dbguMp8TVf47Fj4otwWryRDx8AH.jpg","poster_path":"https://image.tmdb.org/t/p/original/vvLGc3gJQ32PIXnw9Rk1W7fdKxr.jpg","certification":"L","genres":["Comédia","Romance"],"trailer":"N/A"},
"19101":{"id":"19101","name":"A Princesinha","slug":"a-princesinha","original_title":"A Little Princess","overview":"1914, Simla, Índia. Sara Crewe (Lisel Matthews) é uma garota inglesa que vivia feliz, apesar de ser órfã de mãe. Quando eclodiu a 1ª Guerra Mundial seu pai, o capitão Crewe (Liam Cunningham), que pertencia ao exército inglês, tem que ir para a guerra. Porém antes vai a Nova York para deixar Sara num luxuoso internato para moças, no qual a mãe dela já estudara e que é administrado agora com mão de ferro pela Srta. Minchin (Eleanor Bron). A Srta. Minchin fica incomodada com a criatividade de Sara, que logo cativa a maioria das garotas. Um dia o Sr. Barrow (Vincent Schiavelli), o advogado do pai de Sara, chega no colégio para dizer que não haveriam mais pagamentos, pois o pai de Sara tinha morrido em combate. Minchin então faz Sara trabalhar como uma criada, para pagar sua estada ali.","first_air_date":"1995-05-10","runtime":97,"episode_run_time":[97],"vote_average":7.6,"created_by":["Warner Bros. Pictures","Warner Bros. Family Entertainment","Baltimore Pictures","Mark Johnson Productions"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Warner Bros. Family Entertainment"},{"name":"Baltimore Pictures"},{"name":"Mark Johnson Productions"}],"cast":["Liesel Matthews","Eleanor Bron","Liam Cunningham","Rusty Schwimmer","Vanessa Lee Chester"],"backdrop_path":"https://image.tmdb.org/t/p/original/tcMVpjdEpsXrbPtVrSmh4uDBSiy.jpg","poster_path":"https://image.tmdb.org/t/p/original/cZZPfGiiuCRx6tIbY6tESpbRmuE.jpg","certification":"N/A","genres":["Drama","Família","Fantasia"],"trailer":"N/A"},
