"449459":{"id":"449459","name":"O Mistério do Farol","slug":"o-misterio-do-farol","original_title":"The Vanishing","overview":"Em uma ilha desabitada, a 20 milhas da costa escocesa, três guardas de faróis chegam para um turno de seis semanas. À medida que Thomas, James e Donald se instalam em suas rotinas habituais e solitárias, algo inesperado acontece: eles tropeçam em algo que não é seu e que não sabem de onde veio. Com a presença desse objeto vem o início de uma luta pela sobrevivência. Aos poucos, os três homens são conduzidos à destruição por meio da ganância pessoal aliada ao isolamento e à paranoia.","first_air_date":"2019-01-04","runtime":107,"episode_run_time":[107],"vote_average":5.7,"created_by":["Mad as Birds","Head Gear Films","Kodiak Pictures","Metrol Technology","Cross Creek Pictures","iWood Studios","G-BASE","Protagonist Pictures","Saban Films"],"production_companies":[{"name":"Mad as Birds"},{"name":"Head Gear Films"},{"name":"Kodiak Pictures"},{"name":"Metrol Technology"},{"name":"Cross Creek Pictures"},{"name":"iWood Studios"},{"name":"G-BASE"},{"name":"Protagonist Pictures"},{"name":"Saban Films"}],"cast":["Gerard Butler","Peter Mullan","Connor Swindells","Søren Malling","Ólafur Darri Ólafsson"],"backdrop_path":"https://image.tmdb.org/t/p/original/83LbQ6xMURQYO03Ilqdr3kwLBxD.jpg","poster_path":"https://image.tmdb.org/t/p/original/fPgC3fcNUViQ8TTAG7ALSphErrL.jpg","certification":"16","genres":["Thriller","Mistério"],"trailer":"2_66Yu-lOd8"},
"51533":{"id":"51533","name":"Balas em Fúria","slug":"balas-em-furia","original_title":"让子弹飞","overview":"Situado na China durante a guerra de 1920, o notório chefe dos bandidos Zhang desce sobre uma remota cidade da província se passando por seu novo prefeito, uma identidade que ele havia sequestrado de Old Tang, ele próprio um impostor de pequeno porte. Determinado a ganhar dinheiro rápido, Zhang logo encontra seu par na tirânica nobreza local Huang, enquanto uma batalha mortal de inteligência e brutalidade se inicia.","first_air_date":"2010-12-20","runtime":132,"episode_run_time":[132],"vote_average":7.8,"created_by":["China Film Group Corporation","JCE Movies","Beijing Bu Yi Le Hu Film Company","Emei Film Studio"],"production_companies":[{"name":"China Film Group Corporation"},{"name":"JCE Movies"},{"name":"Beijing Bu Yi Le Hu Film Company"},{"name":"Emei Film Studio"}],"cast":["Jiang Wen","周潤發","葛优","劉嘉玲","邵兵"],"backdrop_path":"https://image.tmdb.org/t/p/original/jXPtpe8LoVEq77JBFecESeOCjsp.jpg","poster_path":"https://image.tmdb.org/t/p/original/bVD0C5lXavc5NKAcbOJ9UGgQVTd.jpg","certification":"N/A","genres":["Ação","Comédia"],"trailer":"N/A"},
"1406":{"id":"1406","name":"Amigos, Sempre Amigos","slug":"amigos-sempre-amigos","original_title":"City Slickers","overview":"O nova-iorquino Mitch Robbins (Crystal) está com 39 anos e sente-se péssimo. Está cansado de seu emprego e entediado com sua vida. E seus dois melhores amigos Ed (Kirby) e Phil (Stern) não estão muito melhor. Então, quando decidem fugir da rotina tirando umas férias fantásticas, Mitch e seus amigos trocam suas malas por sacos de viagem e partem em busca de liberdade e de aventura tocando gado sob o vasto céu do Novo México. Mas o que eles descobrem de fato é um sol escaldante, dores nas costas... e uma visão mais profunda de si mesmos - e um do outro - do que jamais haviam imaginado!","first_air_date":"1991-06-07","runtime":114,"episode_run_time":[114],"vote_average":6.4,"created_by":["Castle Rock Entertainment","Nelson Entertainment","Face Productions","Columbia Pictures"],"production_companies":[{"name":"Castle Rock Entertainment"},{"name":"Nelson Entertainment"},{"name":"Face Productions"},{"name":"Columbia Pictures"}],"cast":["Billy Crystal","Daniel Stern","Bruno Kirby","Patricia Wettig","Helen Slater"],"backdrop_path":"https://image.tmdb.org/t/p/original/kMKrch4j1oYA4stINKZHZwpkeok.jpg","poster_path":"https://image.tmdb.org/t/p/original/six4Cj5CjsGmZLFWHvFF7b3wctB.jpg","certification":"N/A","genres":["Comédia","Faroeste"],"trailer":"N/A"},
