"7461":{"id":"7461","name":"Ponto de Vista","slug":"ponto-de-vista","original_title":"Vantage Point","overview":"O presidente dos Estados Unidos, Ashton (William Hurt), participará de uma conferência mundial sobre o combate ao terrorismo em Salamanca, na Espanha. Thomas Barnes (Dennis Quaid) e Kent Taylor (Matthew Fox) são os agentes do Serviço Secreto designados para protegê-lo durante o evento. Entretanto logo em sua chegada o presidente é baleado, o que gera um grande tumulto. Na multidão que assiste ao atentado está Howard Lewis (Forest Whitaker), um turista americano que estava gravando tudo para mostrar aos filhos quando retornasse para casa. A partir da perspectiva de diversos presentes no local antes e depois do atentado é que se pode chegar à verdade sobre o ocorrido.","first_air_date":"2008-02-01","runtime":89,"episode_run_time":[89],"vote_average":6.4,"created_by":["KanZaman Productions","Relativity Media","Original Film","Art In Motion","Columbia Pictures"],"production_companies":[{"name":"KanZaman Productions"},{"name":"Relativity Media"},{"name":"Original Film"},{"name":"Art In Motion"},{"name":"Columbia Pictures"}],"cast":["Dennis Quaid","Matthew Fox","Forest Whitaker","Sigourney Weaver","William Hurt"],"backdrop_path":"https://image.tmdb.org/t/p/original/tmh9zbHQiugRMloFk8co3PBmtoo.jpg","poster_path":"https://image.tmdb.org/t/p/original/l6GfH36v9wK591JhhGvvBcsR5nc.jpg","certification":"14","genres":["Drama","Ação","Thriller","Crime"],"trailer":"N/A"},
"58151":{"id":"58151","name":"A Hora do Espanto","slug":"a-hora-do-espanto","original_title":"Fright Night","overview":"Charley está encantado por sua namorada Amy, o que faz com que ele não dê muita atenção ao papo do amigo Ed sobre o fato do novo vizinho dele, Jerry Dandridge, ser um vampiro. Na verdade, nem mesmo sua mãe Jane acredita que ele possa fazer mal a alguém, mas o sumiço de Ed faz com que Charley comece a investigar e sua descoberta coloca todos em perigo. A única salvação parece ser Peter Vincent, famoso mágico da cidade que parece entender de vampiros, mas depois afirma ser tudo fantasia. E agora?","first_air_date":"2011-08-18","runtime":106,"episode_run_time":[106],"vote_average":6.2,"created_by":["Gaeta / Rosenzweig Films","DreamWorks Pictures","Michael De Luca Productions","Reliance Entertainment"],"production_companies":[{"name":"Gaeta / Rosenzweig Films"},{"name":"DreamWorks Pictures"},{"name":"Michael De Luca Productions"},{"name":"Reliance Entertainment"}],"cast":["Anton Yelchin","Colin Farrell","Toni Collette","David Tennant","Imogen Poots"],"backdrop_path":"https://image.tmdb.org/t/p/original/llSmoD6mmfIQIQspwbckAYd110Z.jpg","poster_path":"https://image.tmdb.org/t/p/original/3FRvJEZFB2eNtYKJlopC5LI3i6O.jpg","certification":"N/A","genres":["Terror","Comédia"],"trailer":"N/A"},
"16007":{"id":"16007","name":"Death Note: O Primeiro Nome","slug":"death-note-o-primeiro-nome","original_title":"デスノート","overview":"Yagami Light é um brilhante estudante da faculdade que, um dia, encontra um caderno de notas intitulado \"Death Note\". Dentro deste caderno está uma lista de regras e detalhes para o uso do \"Death Note\". Quando ele se dá conta do poder que ostenta, decide mudar o mundo a sua maneira. Ele quer transformar o mundo em um lugar melhor matando aqueles que ameaçam a paz do mesmo. \"Kira\", codinome L, um brilhante detetive que vive secretamente, surge das sombras e dedica-se a tentar capturar Light. Ambos, L e Light, vivem em busca da Justiça e de uma disputa que definirá qual deles é o \"bom\" e qual é o \"mau\".","first_air_date":"2006-06-17","runtime":126,"episode_run_time":[126],"vote_average":7.1,"created_by":["Nippon Television Network Corporation","Shueisha","Shochiku","VAP","Nikkatsu Corporation","Horipro","Warner Bros. Japan"],"production_companies":[{"name":"Nippon Television Network Corporation"},{"name":"Shueisha"},{"name":"Shochiku"},{"name":"VAP"},{"name":"Nikkatsu Corporation"},{"name":"Horipro"},{"name":"Warner Bros. Japan"}],"cast":["藤原竜也","松山ケンイチ","瀬戸朝香","細川茂樹","戸田恵梨香"],"backdrop_path":"https://image.tmdb.org/t/p/original/o8HOv12JGZ0YyetTbxkla0S1o6Q.jpg","poster_path":"https://image.tmdb.org/t/p/original/jx6E3bufNYBdzPNkVLEvEKOLwq5.jpg","certification":"16","genres":["Fantasia","Mistério","Thriller"],"trailer":"mgWMnIdVJr4"},
